pragma solidity ^0.8.4;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "./MoretInterfaces.sol";
import "./VolatilityChain.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract OptionContract is AccessControl, IOption
{
  using EnumerableSet for EnumerableSet.UintSet;
  using EnumerableSet for EnumerableSet.Bytes32Set;
  using EnumerableSet for EnumerableSet.AddressSet;

  bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
  bytes32 public constant MARKET_MAKER_ROLE = keccak256("MARKET_MAKER_ROLE");

  mapping(uint256=> Option) internal optionsList;
  uint256 public optionCounter = 0;

  AggregatorV3Interface internal priceInterface;
  VolatilityChain internal volatilityChain;
  EnumerableSet.AddressSet allowedMarketMakerAddresses;

  uint256 public priceMultiplier;
  uint256 public priceDecimals;
  uint256 internal pctDenominator = 10 ** 6;
  EnumerableSet.UintSet tenors;

  Percent public volPremiumFixedAddon = Percent(5 * 10 ** 3, 10 ** 6) ;
  Percent public deltaRange = Percent(8 * 10 ** 5, 10 ** 6) ;

  constructor(
      address _chainlinkAddress,
      address _volChainAddress
      )
      {
          _setupRole(ADMIN_ROLE, msg.sender);
          _setupRole(MARKET_MAKER_ROLE, msg.sender);

          priceInterface = AggregatorV3Interface(_chainlinkAddress);
          volatilityChain = VolatilityChain(_volChainAddress);

          priceDecimals = priceInterface.decimals();
          priceMultiplier = 10 ** priceDecimals;

          tenors.add(1 days);
      }

    function descriptionHash() external view returns (bytes32)
    {
      return keccak256(abi.encodePacked(priceInterface.description()));
    }

    function addTenor(uint256 _tenor) external onlyRole(ADMIN_ROLE){
      require(!tenors.contains(_tenor));
      tenors.add(_tenor);
    }
    function removeTenor(uint256 _tenor) external onlyRole(ADMIN_ROLE){
      require(tenors.contains(_tenor));
      tenors.remove(_tenor);
    }
    function containsTenor(uint256 _tenor) external view returns (bool){
      return(tenors.contains(_tenor));
    }

    function addMarketMaker(address _adr) external onlyRole(ADMIN_ROLE){
      require(!allowedMarketMakerAddresses.contains(_adr));
      allowedMarketMakerAddresses.add(_adr);
    }
    function removeMarketMaker(address _adr) external onlyRole(ADMIN_ROLE){
      require(allowedMarketMakerAddresses.contains(_adr));
      allowedMarketMakerAddresses.remove(_adr);
    }

    function queryPrice() public view returns(uint256, uint256){
      (,int _price,,uint _timeStamp,) = priceInterface.latestRoundData();
     return (uint256(_price), uint256(_timeStamp));
    }

    function queryVol(uint256 _tenor) public view returns (uint256){
      require(tenors.contains(_tenor));
      return volatilityChain.getVol(_tenor);
    }

    function queryOptionCost(uint256 _tenor, uint256 _strike, PayoffType _poType, uint256 _amount,
      uint256 _fee, uint256 _feeDenomninator, uint256 _volAddon, uint256 _volAddonDenominator)
      external view returns(uint256, uint256)
    {
        require(tenors.contains(_tenor));
        require((_poType==PayoffType.Call) || (_poType==PayoffType.Put));

        (uint256 _price,) = queryPrice();
        uint256 _volatility = volatilityChain.getVol(_tenor);

        return  (calcPremium(_price, _volatility, _strike, _poType, _amount, _volAddon, _volAddonDenominator),
         calcFee(_amount, _fee, _feeDenomninator));
    }

    function calcPremium(uint256 _price, uint256 _volatility, uint256 _strike, PayoffType _poType, uint256 _amount,
      uint256 _volAddon, uint256 _volAddonDenominator)
      public view returns(uint256){
        uint256 _intrinsicValue = calcIntrinsicValue(_strike, _price, _poType) * _amount / priceMultiplier;
        uint256 _timeValue = calcTimeValue( _price, _volatility) * _amount / priceMultiplier;
        /* uint256 _margin = MulDiv(volPremiumFixedAddon, _amount, pctDenominator); */
        /* uint256 _addon = calcVolPremiumAddon(_strike, _poType, _amount); */

        return (_intrinsicValue + (_timeValue * (_volAddonDenominator + _volAddon) / _volAddonDenominator)) * priceMultiplier / _price;
    }

    function calcIntrinsicValue(uint256 _strike, uint256 _price, PayoffType _poType) public pure returns(uint256)
    {
        uint256 _intrinsicValue = 0;

        if((_poType==PayoffType.Call) && (_price > _strike)){
          _intrinsicValue = _price - _strike;
        }
        if((_poType==PayoffType.Put) && (_price<_strike)){
          _intrinsicValue = _strike - _price;
        }
        return _intrinsicValue;
    }

    function calcTimeValue(uint256 _price, uint256 _volatility) public view returns(uint256)
    {
        uint256 _timeValue =  (_price * 4 * _volatility / 10 / priceMultiplier);
        return _timeValue;
    }

    function calcFee(uint256 _amount, uint256 _fee, uint256 _feeDenominator) public pure returns(uint256)
    {
        return _amount * _fee / _feeDenominator;
    }

    function addOption(uint256 _tenor, uint256 _strike, PayoffType _poType, uint256 _amount, uint256 _premium, uint256 _fee)
    external onlyRole(MARKET_MAKER_ROLE) returns(uint256)
    {
        require(tenors.contains(_tenor), "Wrong option tenor.");
        require((_poType==PayoffType.Call) || (_poType==PayoffType.Put), "Use call or put option.");

        (uint256 _price,) = queryPrice();
        uint256 _volatility = volatilityChain.getVol(_tenor);

        optionCounter++;
        uint256 _id = optionCounter;
        optionsList[_id] = Option(
            _poType,
            msg.sender,
            OptionStatus.Draft,
            _id,
            block.timestamp,
            0,
            _tenor,
            0,
            _amount,
            _price,
            _strike,
            _volatility,
            _premium,
            _fee);

        emit newOptionCreated(optionsList[_id]);

        return _id;
    }

    function queryDraftOptionCost(uint256 _id, bool _inVol) external view returns(uint256)
    {
        require(optionsList[_id].status== OptionStatus.Draft);
        if(_inVol)
        {
          return (optionsList[_id].premium + optionsList[_id].fee)  * optionsList[_id].spot / optionsList[_id].volatility;
        }
        return (optionsList[_id].premium + optionsList[_id].fee);
    }

    function queryDraftOptionFee(uint256 _id) external view returns(uint256)
    {
        require(optionsList[_id].status== OptionStatus.Draft);
        return optionsList[_id].fee;
    }

    function queryOptionPremium(uint256 _id) external view returns(uint256)
    {
        return optionsList[_id].premium;
    }
    function queryOptionExposure(uint256 _id, PayoffType _poType) external view returns(uint256)
    {
      if(optionsList[_id].poType==_poType)
      {
          return optionsList[_id].amount;
      }
      return 0;
    }

    function getOptionPayoffValue(uint256 _id) external view returns(uint256)
    {
        (uint256 _price,) = queryPrice();
        return (calcIntrinsicValue(optionsList[_id].strike, _price, optionsList[_id].poType) * optionsList[_id].amount / _price);
    }

    function getOptionHolder(uint256 _id) external view returns (address payable){
      return payable(optionsList[_id].holder);
    }

    function calculateContractDelta(uint256 _id) public view returns(int256){
      int256 _delta = 0;
      if(optionsList[_id].status== OptionStatus.Active)
      {
       (uint256 _price, ) = queryPrice();

        uint256 _vol1DAdjusted = (volatilityChain.getVol(86400) * deltaRange.numerator / deltaRange.denominator);
        uint256 _lowerRange = _price - (_price* _vol1DAdjusted/ priceMultiplier);
        uint256 _upperRange = _price * 2 - _lowerRange;

        _delta = int256(optionsList[_id].amount) / 2;
        if (optionsList[_id].poType==PayoffType.Call)
        {
          if(_upperRange < optionsList[_id].strike)
          {
            _delta = 0;
          }
          if(_lowerRange > optionsList[_id].strike)
          {
            _delta = int256(optionsList[_id].amount);
          }
        }

        if(optionsList[_id].poType==PayoffType.Put)
        {
            _delta *= -1;
          if(_upperRange < optionsList[_id].strike)
          {
            _delta = -int256(optionsList[_id].amount);
          }
          if(_lowerRange > optionsList[_id].strike)
          {
            _delta = 0;
          }
        }
      }
        return _delta;
    }


    function validateOption(uint256 _id, address _holder) external view {
      require(optionsList[_id].holder== _holder, "Not the owner.");
      require((optionsList[_id].effectiveTime + optionsList[_id].tenor) >= block.timestamp, "Option has expired.");
      require(optionsList[_id].status==OptionStatus.Active, "Not active option.");
    }

    function isOptionExpiring(uint256 _id) external view returns (bool)
    {
      return (optionsList[_id].status== OptionStatus.Draft) && ((optionsList[_id].effectiveTime + optionsList[_id].tenor) <= block.timestamp);
    }

    function stampActiveOption(uint256 _id) external onlyRole(MARKET_MAKER_ROLE) {
        optionsList[_id].effectiveTime = block.timestamp;
        optionsList[_id].status = OptionStatus.Active;
    }

    function stampExercisedOption(uint256 _id) external onlyRole(MARKET_MAKER_ROLE){
        optionsList[_id].exerciseTime = block.timestamp;
        optionsList[_id].status = OptionStatus.Exercised;
        emit optionExercised(optionsList[_id]);
    }

    function stampExpiredOption(uint256 _id)  external onlyRole(MARKET_MAKER_ROLE){
        optionsList[_id].status = OptionStatus.Expired;
    }

    function getOption(uint256 _id) external view returns(Option memory) {
        return optionsList[_id];
    }

    event newTenor(uint256 _tenor);
    event newVolatilityToken(address _tokenAddress);

    event newOptionCreated(Option _newOption);
    event newOptionBought(Option _newOption);
    event optionExercised(Option _option);
    event volTokenRecycled(uint256 _tokenAmount);
    event cashSweep();

    event newGovernanceFees(uint256 _fee);
    event newUniswapFees(uint24 _fee);
    event newDeltaRange(uint256 _range);

    event hedgePositionUpdated(int256 _underlyingAmount, int256 _stableAmount, uint256 _transactedPrice);
    event capitalAdded(address _recipient, uint256 _mintMPTokenAmount, uint256 _addedValue);
    event capitalWithdrawn(address _recipient, uint256 _burnMPTokenAmount, uint256 _withdrawValue);
}
